import styled from 'styled-components';

const Aboutus = styled.div`
    margin-top: 100px;
`

const AboutUs = () => {
    return ( 
        <>
            <div className = 'AboutUs'>
                <h1>AboutUs</h1>
            </div>
        </>
    );
}
 
export default AboutUs;
